	};
	
	const ceva = async(requestOptions) => {
		await fetch('http://localhost:8080/foodpanda/loginpage/customers', {requestOptions})
		.then(response => response.json())
	}
	
	ceva(requestOptions);*/

	const addCustomer = async (data) => {
        await fetch(`http://localhost:8080/foodpanda/loginpage/customers`, {
            method: "POST",
            headers: {
                "Content-type": "application/json"
            },
            body: JSON.stringify(data)
        })
    }

	addCustomer(data);

	};


    return (
		<div className='container'>
		<h1>Welcome to DocApp!</h1>
		<form className="add-form">
			<div className="form-control">
				<label> Email </label>
				<input  type="text"
						placeholder="Enter email" value={username} onChange={(e) => setUsername(e.target.value)} />
			</div>
			<div className="form-control">
				<label> Password </label>
				<input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
			</div>
			</form>
				<div>
				
		      	<button onClick={(e) => onClickSave(e)} class="btn btn-primary btn-block" type="submit">Save</button>
				
				</div>
      </div>
    )
};



export default LoginCustomer
